	(function($) {
		

		$.suggest = function(input, options) {
	
			var $input = $(input).attr("autocomplete", "off");
			var $btnCancle = $(options['btnCancle']);
			var $btnClose = options['btnClose'];
			var $filter = $(input).parents('.ui-listview-filter');
			var $results;


			var timeout = false;		// hold timeout ID for suggestion results to appear	
			var prevLength = 0;			// last recorded length of $input.val()
			var cache = [];				// cache MRU list
			var cacheSize = 0;			// size of cache in chars (bytes?)
			
			// if($.trim($input.val())=='' || $.trim($input.val())=='所在城市') $input.val('所在城市').css('color','#666');
			if( ! options.attachObject )
				options.attachObject = $(document.createElement("ul")).appendTo('body');

			$results = $(options.attachObject);
			$results.addClass(options.resultsClass);
			
			resetPosition();
			$(window)
				.load(resetPosition)		// just in case user is changing size of page while loading
				.resize(resetPosition);


			displayItems('');
			// renderCityList('#citylist',allCity);
			selectItem();
			// slideByLetter();
			
			$input.focus(function(){
				$('.mask').hide();
				$filter.css('margin-right','5rem');
				$btnCancle.show();
				if($('#overflow')){
               		 // var parent_scrollTop = $('#overflow').scrollTop();
               		$('#overflow').scrollTop(0);
               		return;
               	}
				$(document.body).scrollTop(0);
				if($.trim($(this).val())==''){
					setTimeout(function() { $results.hide() }, 200);					
				}
			});
			$input.blur(function(){
				$('.mask').show();

			})
			$input.on('input',function(){
				if(!$(this).val().length){
					setTimeout(function() { $results.hide() }, 200);	

				}
				suggest();
			});
			//取消
			$btnCancle.on('touchend',function(){
				// alert(1);
				$filter.css('margin-right','0px');
				$btnCancle.hide();

				$input.val('').blur();
				displayItems('');
				selectItem();

			});
			$btnClose.on('click',function(){
				$('#popup_city').removeClass('slideLeft');
			    $(window).scrollTop(options['oldScrollTop']);
			});

			
						
			// help IE users if possible
			try {
				$results.bgiframe();
			} catch(e) { }

			
			
			function resetPosition() {
				// requires jquery.dimension plugin
				var offset = $input.offset();
				// $results.css({
				// 	top:46+ 'px',
				// 	left: 0+'px'
				// });
			}
			
		
			
			function suggest() {
			
				var q = $.trim($input.val());
				displayItems(q);
				selectItem();

			}		
			function displayItems(items) {
				var strHtml = '';
				if (items=='') {//热门所在城市遍历
					strHtml= '<li><span class="list-divider">热门城市</span><ul class="ui-listview">';
					for (var i = 0; i < options.hot_list.length; i++) {//国内所在城市匹配

						strHtml +='<li class="list-search"  data-countryCode="'+options.hot_list[i]['cityCode']+'">'+options.hot_list[i]['cityName']+'</li>';
					}
					
					strHtml+='</ul></li>';
					

				}
				else {
					
					for (var i = 0; i < options.source.length; i++) {//国内所在城市匹配
						var reg = new RegExp('^' + items + '.*$', 'im');
						// console.log(reg);
						
						if (reg.test(options.source[i]['countyName']) || reg.test(options.source[i]['spellfullName']) || reg.test(options.source[i]['spellforshort'])) {
							strHtml += '<li class="list-search" rel="' +options.source[i]['spellforshort'] + '" data-countryCode="'+options.source[i]['countryCode']+'">' + options.source[i]['countyName'] + '</li>';
						}
					}
					if (strHtml == '') {
						suggest_tip = '<li class="gray search_result_tip">对不起，找不到：' + items + '</li>';
					}
					else {
						suggest_tip = '';
					}
					strHtml = suggest_tip + '<li><ul class="ui-listview">' + strHtml + '</ul></li>';
				}

				$results.html(strHtml).show();
			}

			function selectItem(){
				$('.ui-listview').on('click',function(e) {

				
					e.preventDefault(); 
					e.stopPropagation();
					$('#bankName').parent().on('click',function(event) {
					 return false;
					});
						
					if(e.target.nodeName.toUpperCase()=="LI"){
						// $(e.target).addClass(options.selectClass);
						var selectedCity_name = $(e.target).text();
						var selectedCity_countyCode = $(e.target).data('countyCode');
						
						$(options.parentCityInput).text(selectedCity_name).data('countyCode',selectedCity_countyCode).parent().removeClass('cgray');

						$('#popup_city').removeClass('slideLeft');

					    if($('#overflow')){$('#overflow').scrollTop(0);}
						$(document.body).scrollTop(0);

						// $('.titleBox').hide();
  						// $('.flight-ctltsfixed').css('display','none');
						$filter.css('margin-right','0px');
						$btnCancle.hide();
						$input.val('');
						hideError();
						
					}
		
				});
			}	

	
		}

		
		$.fn.suggest = function(source, options) {
		
			if (!source)
				return;
		
			options = options || {};
			allCity = options.allCity ||[];
			options.source = source;
			options.hot_list=options.hot_list || [];
			options.delay = options.delay || 0;
			options.resultsClass = options.resultsClass || 'ac_results';
			options.selectClass = options.selectClass || 'ac_over';
			options.matchClass = options.matchClass || 'ac_match';
			options.minchars = options.minchars || 1;
			options.delimiter = options.delimiter || '\n';
			options.onSelect = options.onSelect || false;
			options.dataDelimiter = options.dataDelimiter || '\t';
			options.dataContainer = options.dataContainer || '#SuggestResult';
			options.attachObject = options.attachObject || null;
			options.parentCityInput = options.parentCityInput || null;

			this.each(function() {
				new $.suggest(this, options);
			});
	
			return this;
			
		};
		
	})(jQuery);


function compare(propertyName){
	return function(object1,object2){
		var value1 = object1[propertyName];
		var value2 = object2[propertyName];
		if(value1>value2){
			return 1;
		}else if(value1<value2){
			return -1;
		}else{
			return 0;
		}
	}
}


function renderLetterDivider(con) {
	var _citygrouphtml = '';
	if (_citygrouphtml.length === 0) {
		var b = [];
		var a = "ABCDEFGHJKLMNOPQRSTWXYZ".split("");
		for (var c in a) b.push('<li data-letters="' + a[c] + '" id="' + a[c] + '" data-role="list-divider" ><span class="list-divider">' + a[c] + '</span><ul class="ui-listview"></ul></li>');
	var _html= con.html();
	_citygrouphtml = b.join('');
	con.html(_html+_citygrouphtml);
	}
}

function renderCityList(id,allCity){
	var con = $(id);
	renderLetterDivider(con);
	
	
	var city;listHtml = [];
	if(allCity && allCity.length){
		var citygroup = {};
		var allCity = allCity.sort(compare('spellfullName'));
		var temp = [];
		var a = "ABCDEFGHJKLMNOPQRSTWXYZ".split("");
		for (var c in a) {
			temp = $.grep(allCity, function(ele, index){
				if(ele['spellforshort'].substr(0,1)==a[c])
		   
			        return true;
			  
			}, false);
			citygroup[a[c]]=temp;

			

		}
		for(var key in citygroup){
			// console.log(key);
			var this_group = citygroup[key];
			var listHtml = [];
			var city_len = this_group.length;
			for(var i=0;i<city_len;i++){
				listHtml.push('<li class="list-search" rel="'+this_group[i]['spellforshort']+'">'+this_group[i]['countyName']+'</li>');


			}
			var html = listHtml.join('');
			$('#'+key).find('ul').html(html);
		}
		
		

	}else{
		return;
	}
	

}
